sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.user_to_update = {};
  outputs.user_to_update.name = inputs.name;
  outputs.user_to_update.email = inputs.email;
  outputs.user_to_update.password = inputs.password;
  outputs.user_to_update.admin = inputs.admin;
  outputs.user_to_update.profileUpdatable = inputs.profileUpdatable;
  outputs.user_to_update.disableUIAccess = inputs.disableUIAccess;
  outputs.user_to_update.internalPasswordDisabled = inputs.internalPasswordDisabled;
  outputs.user_to_update.watch_manager = inputs.watch_manager;
  outputs.user_to_update.policy_manager = inputs.policy_manager;

  if(inputs.groups.length > 0){
    outputs.user_to_update.groups = [];
    for(var i = 0; i < inputs.groups.length; i++) {
      outputs.user_to_update.groups[i] = inputs.groups[i];
    }
  }
})(inputs, outputs);

